import React from 'react';
import '../styles/MainPage.css';

function MainPage() {
  return (
    <div className="main-page">
      <h1>Project 1010791 UI Sketch</h1>
      <h2>Data Preserving Face Recognition</h2>
      <div className="button-group">
        <button className="button">Project Using Screen</button>
        <button className="button">Photo Upload / Train</button>
      </div>
      <div className="upload-section">
        <button className="upload-button">Upload Image</button>
        <button className="upload-button">Upload & Test</button>
      </div>
    </div>
  );
}

export default MainPage;
